import React, { useEffect, useState } from "react";
import axios from "axios";
const Photo = () => {
  return (
    <div>
      <div className="anima"></div>
      <style jsx>{`
        .anima {
          width: 100%;
          height: 100px;
        }
        img {
          width: 100%;
        }
      `}</style>
    </div>
  );
};

export default Photo;
